import React, { Component, Fragment } from 'react'
import { Card, Modal } from 'react-bootstrap';

class RestaurantCard extends Component {
    constructor(props, context) {
        super(props, context);

        this.state = {
          show: false,
        };

        this.handleShow = () => {
          this.setState({ show: true });
        };

        this.handleHide = () => {
          this.setState({ show: false });
        };
      }

    render() {
        console.log(this.props)
        return (
            <Fragment>
                <Card className="card" onClick={(e) => this.props.handleCardClick(this.props.restaurantObj)} 
                    onClick={this.handleShow}
                    >
                    <Card.Img variant="top" src={this.props.restaurantObj.photo} />
                    <Card.Body>
                        <Card.Title>{this.props.restaurantObj.name}</Card.Title>
                        <Card.Text>
                            Rating: {this.props.restaurantObj.rating}
                        </Card.Text>
                        <Card.Text>
                            Address: {this.props.restaurantObj.address}
                        </Card.Text>
                    </Card.Body>
                </Card>

                <Modal
                    show={this.state.show}
                    onHide={this.handleHide}
                    dialogClassName="modal-90w"
                    aria-labelledby="example-custom-modal-styling-title">
                    <Modal.Header closeButton>
                        <Modal.Title id="example-custom-modal-styling-title">
                            Custom Modal Styling
                    </Modal.Title>
                    </Modal.Header>
                    <Modal.Body>
                        <p>
                            Ipsum molestiae natus adipisci modi eligendi? Debitis amet quae
                            unde commodi aspernatur enim, consectetur. Cumque deleniti
                            temporibus ipsam atque a dolores quisquam quisquam adipisci
                            possimus laboriosam. Quibusdam facilis doloribus debitis! Sit
                            quasi quod accusamus eos quod. Ab quos consequuntur eaque quo rem!
                            Mollitia reiciendis porro quo magni incidunt dolore amet atque
                            facilis ipsum deleniti rem!
                    </p>
                    </Modal.Body>
                </Modal>
            </Fragment>


        )
    }
}

export default RestaurantCard
